import React from "react";
import Navigation from './components/navigation';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      currentview: 'Navigation'
    }
  }
  render() {
    return (
      <div className="App">
        <Navigation />
      </div>
    )
  }
}

export default App;
